<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>Keywords Reserved for Future Use</title>
</head>
<body>
<h1>Keywords Reserved for Future Use</h1>
<p>The following keywords do not yet have any functionality but are reserved by
Rust for potential future use:</p>
<ul>
<li><code>abstract</code></li>
<li><code>become</code></li>
<li><code>box</code></li>
<li><code>do</code></li>
<li><code>final</code></li>
<li><code>gen</code></li>
<li><code>macro</code></li>
<li><code>override</code></li>
<li><code>priv</code></li>
<li><code>try</code></li>
<li><code>typeof</code></li>
<li><code>unsized</code></li>
<li><code>virtual</code></li>
<li><code>yield</code></li>
</ul>
</body>
</html>
